import React from "react";
import EditProfileList from './profile';
import {Link} from "react-router-dom";


const EditProfileScreen = () => {
    return(
        <div>
            <div style={{"position":"relative", "height":"50px"}}>
                <Link to="/tuiter/profile" id="profile" style={{"background-color": "#1e2125", "color": "white","bottom":"60px", "right":"20px", "position":"absolute"}}>
                    <button style={{"color":"white", "background-color":"black"}}><i className="fa-solid fa-xmark"> </i></button>
                </Link >
                <text style={{"font-size":"20px", "color":"white"}}><strong> Edit profile</strong></text>
                <span style={{"right":"20px", "position":"absolute"}}>
                    <button onClick="myFunction()" style={{"color":"black", "background-color":"white", "border-radius": "30%"}}>Save</button>
                </span>
            </div>
            <div>
                <EditProfileList/>
            </div>
        </div>
    );
};
export default EditProfileScreen;
